import React from 'react';

import Countdown from './Countdown';
import '../../styles/css/fightZone/DisplayCountdown.css';

class Display extends React.Component {
  constructor(props) {
    super(props);
    this.state = { counter: 60 };
  }
  render() {
    const { setTimeOut, counter, modaleIsOpen } = this.props;
    console.log(setTimeOut, counter, modaleIsOpen);
    return (
      <div className="fightZone">
        <Countdown val={60} counter={counter} />
      </div>
    );
  }
}

export default Display;

